import React from 'react';
import Statsmusic from '../../components/statsmusic/Statsmusic';
import './music.css';
import minutes from '../../assets/minutes.png';
import artist from '../../assets/artist.png';
import genre from '../../assets/genre.png';
import tops from '../../assets/tops.png';
import topsong from '../../assets/topsong.png'

const Music = () => {
  return (
    <div className='portfolio-music'>
        <div>
            <Statsmusic image={minutes} Title="Minutes spent listening to Music" Text="About 21 days of the year spent listening to music. According spotify statistics, that's more than 83% of other listeners in the Unites States." Technologies=""/>
            <Statsmusic image={artist} Title="Favorite Artist" Text="Of the 1419 artists that I've listened to this year, 1573 minutes were spent listening to Dua Lipa's songs which puts it at the top 0.5% listeners of hers." Technologies=""/>
            <Statsmusic image={genre} Title="Top Genres" Text="I am a huge fan of pop culture and EDM music. I've explored 73 different genres this year. Who knew there even existed so many genres?" Technologies=""/>
            <Statsmusic image={tops} Title="Top Song" Text="This song was love at first listen. Lost frequencies beats and Calum Scott's voice " Technologies=""/>
        </div>
    </div>
  )
}

export default Music
